import React from "react";
import { Provider } from "./expenses/Context";
import Form from "./expenses/components/form";
import UserList from "./expenses";
import { Actions } from "./income/Action";
function App() {
  const data = Actions();
  return (
    <Provider value={data}>
      <div className="App">
        <h1>ADD INCOME</h1>
        <div className="wrapper">
          <section className="left-side">
            <Form />
          </section>
          <section className="right-side">
            <UserList />
          </section>
        </div>
      </div>
    </Provider>
  );
}

export default App;
